def solve():
    s = "t110 t18 t52 t146 t179 t164 t46 t139 t125 t23 t82 t171 t107 t78"

    result = analyze_string(s)
    print(result)

def analyze_string(s):

    result = ""
    for char in s:
        if char.isdigit():
            result += char
        elif char.isalpha():
            result += char
        else:
            result += " "
    return result

solve()
```

